import React from 'react';
import Calendario from '../../components/Calendario';
import * as C from './styles';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser } from '@fortawesome/free-solid-svg-icons';

const Home = () => {
    return (
        <C.Container>
            <C.Navbar>
                <C.IconContent></C.IconContent>
                <C.IconContent>
                    <FontAwesomeIcon icon={faUser} class="fa-1x" />
                </C.IconContent>
            </C.Navbar>
            <C.CalendarContainer>
                <C.CalendarContent>
                    <Calendario />
                </C.CalendarContent>
                <C.DateInfoContent>
                    Informações do calendario
                </C.DateInfoContent>
            </C.CalendarContainer>
        </C.Container>
    )
}

export default Home
